import React from 'react';

export default function Skills() {
  const frontend = ['React.js', 'React Native', 'HTML5', 'CSS3', 'JavaScript', 'Bootstrap', 'Tailwind CSS'];
  const backend = ['Node.js', 'Express.js', 'REST APIs'];
  const db = ['MongoDB', 'Mongoose'];
  const design = ['Figma', 'UI/UX Design', 'Wireframing', 'Prototyping'];
  const tools = ['Git', 'GitHub', 'Postman', 'VS Code'];

  const renderBadges = (list) => list.map((s, i) => <span key={i} className="skill-badge">{s}</span>);

  return (
    <div className="container skills-card">
      <h2>Skills</h2>
      <div className="skills-grid">
        <div>
          <h3>Frontend</h3>
          <div>{renderBadges(frontend)}</div>
        </div>
        <div>
          <h3>Backend</h3>
          <div>{renderBadges(backend)}</div>
        </div>
        <div>
          <h3>Database</h3>
          <div>{renderBadges(db)}</div>
        </div>
        <div>
          <h3>Design</h3>
          <div>{renderBadges(design)}</div>
        </div>
        <div>
          <h3>Tools</h3>
          <div>{renderBadges(tools)}</div>
        </div>
      </div>
    </div>
  );
}
